package com.leetcode.easy.first_unique_character_in_a_string;

import org.junit.Test;

import static org.junit.Assert.assertEquals;

public class SolutionTest {

    @Test
    public void test_1() {

        String s = "leetcode";
        int actual = new Solution().firstUniqChar(s);

        int expected = 0;

        assertEquals(expected, actual);
    }

    @Test
    public void test_2() {

        String s = "loveleetcode";
        int actual = new Solution().firstUniqChar(s);

        int expected = 2;

        assertEquals(expected, actual);
    }

    @Test
    public void test_3() {

        String s = "l";
        int actual = new Solution().firstUniqChar(s);

        int expected = 0;

        assertEquals(expected, actual);
    }

    @Test
    public void test_4() {

        String s = "ll";
        int actual = new Solution().firstUniqChar(s);

        int expected = -1;

        assertEquals(expected, actual);
    }

    @Test
    public void test_5() {

        String s = "";
        int actual = new Solution().firstUniqChar(s);

        int expected = -1;

        assertEquals(expected, actual);
    }

    @Test
    public void test_6() {

        String s = "";
        int actual = new Solution().firstUniqChar(s);

        int expected = -1;

        assertEquals(expected, actual);
    }

}
